import "./ExpenseDisplay.css";
import ExpenseItem from "./components/ExpenseItem";

function ExpenseDisplay(props) {

  return (
    <div className="expenses">
      <h2>Expense Display Title</h2>
      <p>Wow - is this working?</p>
      <div>
        title={props[0].title}
        amount={props[0].amount}
        date={props[0].date}
      </div>
      <div>
        title={props.title[1]}
        amount={props.amount[1]}
        date={props.date[1]}
      </div>
      <div>
        title={props[2].title}
        amount={props[2].amount}
        date={props[2].date}
      </div>
      <div>
        title={props[3].title}
        amount={props[3].amount}
        date={props[3].date}
      </div>
    </div>
  );
}

export default ExpenseDisplay;
